        method: "GET", 
        // mode: 'no-cors',
        headers:{
          "Content-Type" : "application/json",
        },
      }).then(
      res => {console.log(res); return res.json();}
  ).then(
      res => {
          setData(res)
          console.log(res)

      }
  )
} 
